import styled from 'styled-components';

export const PostBlock = styled.li`
    cursor: pointer;
    background: palegoldenrod;
    margin-top: 25px;
    padding: 20px;
    width: 28%;
    box-shadow: 9px 10px 5px 0px rgba(57, 82, 63, 0.8);
`;

export const Title = styled.p`
    color: rgb(25, 41, 31);
    font-size: 30px;
`;

export const Body = styled.p`
    color: rgb(54, 59, 56);
    font-size: 20px;
`;
